// 设置高度的逻辑
function setList2Height(naturalIngredients) {
    // 提取数值部分
    const percent = parseInt(naturalIngredients.replace('%', ''), 10);

    // 定义映射规则
    let height;
    switch (percent) {
        case 97:
            height = "260px";
            break;
        case 96:
            height = "230px";
            break;
        case 95:
            height = "190px";
            break;
        case 94:
            height = "160px";
            break;
        default:
            height = "120px"; // 默认最低高度
    }

    // 应用高度，同时保留原来的样式
    secondElement.style.cssText = `${originalStyle}; height: ${height};`;
}

// 设置 .list2 的高度
setList2Height(dataPoint.naturalIngredients);


