            // 根据 scent2 返回对应的填充颜色
            function getFillColor(scent2) {
                switch (scent2) {
                    case "creamy":
                        return "#e0edff";
                    case "nutty":
                        return "#eecfae";
                    case "fresh":
                        return "#cbe2e2";
                    case "sweet":
                        return "#f7e4f2";
                    case "fruity":
                        return "#fff6b0";
                    case "floral":
                        return "#eae4fc";
                    default:
                        return "#ffffff";
                }
            }
            

 
